Category	Feature, Plot Based

Starring	Samantha Saint, Steven St Croix, Kendra Lust, Danny Mountain, Brandi Love, Toni Ribas, Van Wylde

It's New Year's Day and our cast of characters (a businessman, his younger wife and two ex-wives) are nursing hangovers and trying to piece together what happened the night before. Through a series of flashbacks, we learn that partying and hyperactive libidos were responsible for shredded business...

